function ListFilter(e){var t=t||{};t.init=function(e){t.listContainer=e.listContainer;t.filterItemClass=e.filterItemClass;t.inputContainer=e.inputContainer||null;t.inputPrompt=e.inputPrompt||"Search list";t.inputClass=e.inputClass||"";t.filterBlockClass=e.filterBlockClass||null;t.filteredList=$(t.listContainer);t.filterFormID="list-filter-form";t.filterFormInputID="list-filter-input";t.filterForm='<div id="'+t.filterFormID+'">            <label for="'+t.filterFormInputID+'">'+t.inputPrompt+'</label>            <input class="'+t.inputClass+'" type="text" id="'+t.filterFormInputID+'" />        </div>';t.make();return t};t.make=function(){t.addFilterForm();t.addMatcher();return t};t.addFilterForm=function(){if(!!t.inputContainer){$(t.inputContainer).prepend(t.filterForm)}else{$(t.filterForm).insertBefore(t.listContainer)}};t.addMatcher=function(){$("#"+t.filterFormInputID).change(function(){t.filterValue=$(this).val();if(!!t.filterValue){t.match()}else{t.showAllItems()}t.checkNoResults();return false}).keyup(function(){$(this).change()})};t.match=function(){t.filteredList.css("display","none");t.hideUnmatchedItems();t.showMatchedItems();t.filteredList.css("display","block")};t.hideUnmatchedItems=function(){t.filteredList.find(t.filterItemClass+":not(:icontains("+t.filterValue+"))").css("display","none");if(!!t.filterBlockClass){t.filteredList.find(t.filterBlockClass+":not(:has("+t.filterItemClass+":visible))").css("display","none")}};t.showMatchedItems=function(){if(!!t.filterBlockClass){t.filteredList.find(t.filterBlockClass+":has("+t.filterItemClass+":icontains("+t.filterValue+"))").css("display","block")}t.filteredList.find(t.filterItemClass+":icontains("+t.filterValue+")").css("display","block")};t.showAllItems=function(){t.filteredList.find(t.filterBlockClass).css("display","block");t.filteredList.find(t.filterItemClass).css("display","block")};t.checkNoResults=function(){$("#filter-no-results").remove();if($(t.filterItemClass+":visible").length==0){t.filteredList.append('<p id="filter-no-results">No matching results found.</p>')}};t.init(e);return t}$.expr[":"].icontains=function(e,t,n){return(e.textContent||e.innerText||"").toUpperCase().indexOf(n[3].toUpperCase())>=0}